import Layout from "./components/layout";
import Profile from "./components/profile";
import ResetCSS from "./global/resetCSS";

function App() {
  return (
    <main>
      <ResetCSS>
        <Layout>
          <Profile />
          <div>Repositories</div>
          <div>Starreds</div>
        </Layout>
        </ResetCSS>
    </main>
  );
}

export default App;
